import ReactDOM from 'react-dom';
// import App from './App';
import ex_baner from './extraction.jpg';
import safe from './safe.jpg';

import Cards from './Cards';
ReactDOM.render(<><Cards imgsrc= {ex_baner} title="A netflix orignal series."
                      seriesname="EXTENTION" 
                       watch_btn_link="https://www.netflix.com/in/title/80230399"/>
                    <br></br>
                   <Cards imgsrc= {safe} title="A netflix orignal series."
                      seriesname="SAFE" 
                       watch_btn_link="https://www.netflix.com/in/title/80201500"/></>,document.getElementById('root'));
